Not even exaggerating — Candlelight Fridays at @sundayhouseindia  are my new favorite thing.
Walked in for a chill evening… ended up with the best cocktails, vibey music, some crazy-good bar deals, and food I’m still dreaming about.

The whole place just gets what a Friday should feel like — cozy, fun, and a little indulgent.
If you’re looking for a sign to make weekend plans, this is it.
Tag your people and thank me later 💛✨

